    false,nt"url": null,nt"notes": "NCEI Accession 0108367 includes discrete
    sample and profile data collected from DISCOVERY in the Davis Strait, Labrador Sea
    and North Atlantic Ocean from 2008-08-20 to 2008-09-25. These data include DISSOLVED
    INORGANIC CARBON (DIC), DISSOLVED OXYGEN, HYDROSTATIC PRESSURE, NITRATE, Potential
    temperature (theta), SALINITY, TOTAL ALKALINITY (TA), WATER TEMPERATURE, phosphate
    and silicate. The instruments used to collect these data include CTD and bottle.nnThese
    data were collected by S. Bacon of National Oceanography Centre, Southampton and
    Ute Schuster and Oliver Legge of University of East Anglia; School of Environmental
    Sciences as part of the CLIVAR_AR07W_74DI20080820 data set. CDIAC associated the
    following cruise ID(s) with this data set: CLIVAR_AR07W_74DI20080820nnThe International
    CLIVAR Global Ocean Carbon and Repeat Hydrography Program carries out a systematic
    and global re-occupation of select WOCE/JGOFS hydrographic sections to quantify
    changes in storage and transport of heat, fresh water, carbon dioxide (CO2), and
    related parameters.",nt"license_title": null,nt"extras": [{ntt"key":
